import React from 'react';
import Graphics3D from './3DGraphics/3DGraphics';
import './Work.css'
window.onload = function () {
  var _parent = document.querySelector('.Index-page-image');
  console.dir(_parent);
  _parent.innerHTML = "";
  _parent.appendChild(window.InteractiveApp.getElement());
  window.InteractiveApp.start();
  window.InteractiveApp.setSize(_parent.offsetWidth, _parent.offsetHeight);
  
  window.addEventListener('resize', () => {
    window.InteractiveApp.setSize(_parent.offsetWidth, _parent.offsetHeight);
  });
}
export default function Work() {
  return (

    <div className="Page">
      <Graphics3D></Graphics3D>
      <div class="Index-page-content  sqs-alternate-block-style-container" id="yui_3_17_2_1_1655312466774_120" style="margin-top: 0px;">
