    <div class="image-block-outer-wrapper layout-caption-hidden design-layout-inline combination-animation-fade-in individual-animation-none individual-text-animation-none animation-loaded" data-test="image-block-inline-outer-wrapper" id="yui_3_17_2_1_1655312466774_114">

      

      
        <figure class="
              sqs-block-image-figure
              intrinsic
            " style="max-width:1511px;" id="yui_3_17_2_1_1655312466774_113">
          
        
        

        
          
            
