              has-aspect-ratio
            " style="
                position: relative;
                
                  padding-bottom:18.5%;
                
                overflow: hidden;
              " id="yui_3_17_2_1_1655312466774_111">
              <noscript><img src="https://images.squarespace-cdn.com/content/v1/5b3eecd5f93fd4a37503dfe8/1537510275583-KX7LMVUAH3HYW6T4SWXL/gestalt-logo-white.png" alt="gestalt-logo-white.png" /></noscript><img class="thumb-image loaded" data-src="https://images.squarespace-cdn.com/content/v1/5b3eecd5f93fd4a37503dfe8/1537510275583-KX7LMVUAH3HYW6T4SWXL/gestalt-logo-white.png" data-image="https://images.squarespace-cdn.com/content/v1/5b3eecd5f93fd4a37503dfe8/1537510275583-KX7LMVUAH3HYW6T4SWXL/gestalt-logo-white.png" data-image-dimensions="1511x282" data-image-focal-point="0.5,0.5" data-load="false" data-image-id="5ba48b81e2c48383bf38172c" data-type="image" style="left: 0%; top: -0.353513%; width: 100%; height: 100.707%; position: absolute;" alt="gestalt-logo-white.png" data-image-resolution="750w" src="https://images.squarespace-cdn.com/content/v1/5b3eecd5f93fd4a37503dfe8/1537510275583-KX7LMVUAH3HYW6T4SWXL/gestalt-logo-white.png?format=750w"/>
            </div>
          </div>
        
          
        

        
      
        </figure>
      

    </div>
  


  


</div></div></div><div class="col sqs-col-4 span-4"><div class="sqs-block spacer-block sqs-block-spacer sized vsize-1" data-block-type="21" id="block-yui_3_17_2_1_1537510110900_13699"><div class="sqs-block-content">&nbsp;</div></div></div></div><div class="sqs-block html-block sqs-block-html" data-block-type="2" id="block-077c5349c769b5b7ca7c"><div class="sqs-block-content"><h2 style="text-align: center; white-space: pre-wrap;">Protocol for Distributed Intelligence</h2>


</div></div><div class="sqs-block spacer-block sqs-block-spacer sized vsize-1" data-block-type="21" id="block-b67156664f503e6afb62"><div class="sqs-block-content">&nbsp;</div></div><div class="sqs-block form-block sqs-block-form" data-block-type="9" id="block-0ff798e0befe7573b818"><div class="sqs-block-content">






  <div data-animation-role="button" class="lightbox-handle-wrapper lightbox-handle-wrapper--align-center">
    <button class="lightbox-handle sqs-system-button sqs-editable-button sqs-button-element--primary">
      
        SIGN UP FOR EARLY ACCESS
      
    </button>
  </div>



</div></div><div class="sqs-block code-block sqs-block-code" data-block-type="23" id="block-yui_3_17_2_1_1539197406571_8088"><div class="sqs-block-content"><script src="https://unpkg.com/gestalt-build-cdn@1.0.1/gestalt.interactive.js"></script>


</div></div></div></div></div>
        </div>
    </div>

  )
}
